import Nav from 'react-bootstrap/Nav';
import './top_nav.css';

function PillsExample() {
  return (
    <Nav variant="pills" defaultActiveKey="/home" className="custom-nav">
      <Nav.Item>
        <Nav.Link href="/serviceprovider/appointments" eventKey="1">New Appointments</Nav.Link>
      </Nav.Item>

      <Nav.Item>
        <Nav.Link href="/serviceprovider/appointments" eventKey="1">Suggested Appointments</Nav.Link>
      </Nav.Item>

      <Nav.Item>
        <Nav.Link href="/serviceprovider/appointments" eventKey="3">Confirmed Appointments</Nav.Link>
      </Nav.Item>

      <Nav.Item>
        <Nav.Link href="/serviceprovider/appointments" eventKey="4">Canceled Appointments</Nav.Link>
      </Nav.Item>

      <Nav.Item>
        <Nav.Link href="/serviceprovider/appointments" eventKey="5">Past Appointments</Nav.Link>
      </Nav.Item>
    </Nav>
  );
}

export default PillsExample;
